import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <div className="navbar">
      <ul className="nav-items">
        <li>
          <a href="/work">Work</a>
        </li>
        <li>
          <a href="/about">About</a>
        </li>
        <li>
          <a href="/contact">Contacts</a>
        </li>
      </ul>
    </div>
  );
}

export default Nav;
